import React from "react";

const ProductList = ({ products }) => {
  return (
    <div id="product-list">
      <header>
        <strong>{`Product List (${products.length} items)`}</strong>
      </header>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Department</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {
            /* Display products here in new table rows */
            products.map(({ id, name, departament, price }) => (
              <tr key={id}>
                <tb>{id}</tb>
                <tb>{name}</tb>
                <tb>{departament}</tb>
                <tb>{price}</tb>
              </tr>
            ))
          }
        </tbody>
      </table>
    </div>
  );
};

export default ProductList;
